CREATE DATABASE SalesDashboardDB;
GO
USE SalesDashboardDB;
GO
-- Tables
CREATE TABLE SalesRegions (RegionID INT PRIMARY KEY, RegionName VARCHAR(100));
CREATE TABLE Customers (CustomerID INT PRIMARY KEY, Name VARCHAR(100), Email VARCHAR(100), RegionID INT);
CREATE TABLE Products (ProductID INT PRIMARY KEY, ProductName VARCHAR(100), Category VARCHAR(50), Price DECIMAL(10, 2));
CREATE TABLE SalesPersons (SalesPersonID INT PRIMARY KEY, Name VARCHAR(100), RegionID INT);
CREATE TABLE Orders (OrderID INT PRIMARY KEY, CustomerID INT, SalesPersonID INT, OrderDate DATE, TotalAmount DECIMAL(10, 2));
CREATE TABLE OrderDetails (OrderDetailID INT PRIMARY KEY, OrderID INT, ProductID INT, Quantity INT, Total DECIMAL(10, 2));
