--Dashboard Query

-- 1. Total Revenue by Region

SELECT 
    r.RegionName, 
    SUM(o.TotalAmount) AS TotalRevenue
FROM Orders o
JOIN Customers c ON o.CustomerID = c.CustomerID
JOIN SalesRegions r ON c.RegionID = r.RegionID
GROUP BY r.RegionName;

-- 2. Monthly Sales Trend

SELECT 
    FORMAT(OrderDate, 'yyyy-MM') AS Month, 
    SUM(TotalAmount) AS MonthlySales
FROM Orders
GROUP BY FORMAT(OrderDate, 'yyyy-MM')
ORDER BY Month;

-- Top Products by Revenue

SELECT 
    p.ProductName, 
    SUM(od.Total) AS Revenue
FROM OrderDetails od
JOIN Products p ON od.ProductID = p.ProductID
GROUP BY p.ProductName
ORDER BY Revenue DESC;

--4. Sales by Category

SELECT 
    p.Category, 
    SUM(od.Total) AS CategorySales
FROM OrderDetails od
JOIN Products p ON od.ProductID = p.ProductID
GROUP BY p.Category
ORDER BY CategorySales DESC;

-- 5. Sales by SalesPerson

SELECT 
    sp.Name AS SalesPerson, 
    SUM(o.TotalAmount) AS SalesAmount
FROM Orders o
JOIN SalesPersons sp ON o.SalesPersonID = sp.SalesPersonID
GROUP BY sp.Name
ORDER BY SalesAmount DESC;

-- 6. KPI: Total Sales

SELECT SUM(TotalAmount) AS TotalSales FROM Orders;

-- 7. KPI: Total Orders

SELECT COUNT(OrderID) AS TotalOrders FROM Orders;

-- 8. KPI: Total Customers

SELECT COUNT(DISTINCT CustomerID) AS TotalCustomers FROM Orders;

-- 9. Top Regions by Order Count

SELECT 
    sr.RegionName, 
    COUNT(o.OrderID) AS TotalOrders
FROM Orders o
JOIN Customers c ON o.CustomerID = c.CustomerID
JOIN SalesRegions sr ON c.RegionID = sr.RegionID
GROUP BY sr.RegionName
ORDER BY TotalOrders DESC;


--Summary Table

SELECT 
    o.OrderID,
    o.OrderDate,
    c.Name AS Customer,
    r.RegionName,
    p.ProductName,
    p.Category,
    od.Quantity,
    od.Total,
    sp.Name AS SalesPerson
FROM Orders o
JOIN Customers c ON o.CustomerID = c.CustomerID
JOIN SalesRegions r ON c.RegionID = r.RegionID
JOIN SalesPersons sp ON o.SalesPersonID = sp.SalesPersonID
JOIN OrderDetails od ON o.OrderID = od.OrderID
JOIN Products p ON od.ProductID = p.ProductID;
